import { GET_USER } from '../../action/types'

const initialState = {
    user: {}
}

export default function(state = initialState, action) {
    console.log("reducer")
    switch (action.type) {
        case GET_USER:
            console.log("GET USER REDUCER")
            return {
                ...state,
                items: action.payload
            }
        case 'REMOVE':
            return state;
        default:
            return state;
    }
}
